    body:
      string: "---\nconfigs:\n- config_name: default\n  data_files:\n  - split: train\n
        \   path: train.jsonl\n  - split: eval\n    path: eval.jsonl\n  - split: dpo\n
        \   path: dpo.jsonl\nlicense: apache-2.0\ntags:\n- code\n---\n\n# Dataset
        for Zeta\n\nThis is the open dataset used to train Zeta, an edit prediction
        model that powers Zed's predictive coding feature. Zeta is derived from Qwen2.5-Coder-7B
        and predicts the developer's next code edit based on their recent programming
        patterns and cursor position, allowing for intelligent completion with a simple
        tab press.\n\nThis dataset is split into three parts:\n\n- `train.jsonl`:
        Contains the training data for supervised fine-tuning.\n- `dpo.jsonl`: Contains
        the data for the direct preference optimization.\n- `eval.jsonl`: Contains
        the evaluation data for the Zeta dataset.\n\nThese files are generated from
        the markdown files in the respective directories.\n\n## Scripts\n\nThere are
        several scripts to help with data processing and evaluation:\n\n- `script/pull-predictions`:
        Pulls predictions from Snowflake.\n- `script/verify_server.py`: Simple webserver
        to manually verify the predictions and adding them to the dataset.\n- `script/gen-dataset`:
        Reads all the markdown files, validates them, and generates the dataset files.\n-
        `script/sft.ipynb`: Jupyter notebook for supervised fine-tuning.\n- `script/dpo.ipynb`:
        Jupyter notebook for direct preference optimization.\n\n### Running Python
        Scripts\n\nSet up Python environment:\n\n```bash\npython -m venv .venv\nsource
        .venv/bin/activate  # On Windows: .venv\\Scripts\\activate\npip install fastapi
        uvicorn\n```\n\nRun the verification UI:\n```bash\npython script/verify_server.py
        predictions train --trash-dir trash\n```\n\nOpen http://localhost:8000 and
        use:\n- 'G' to accept (moves to `train/`)\n- 'B' to reject (moves to `trash/`)\n\n#
        Labeling feedback\n\nSet up Python environment:\n\n```bash\npython -m venv
        .venv\nsource .venv/bin/activate  # On Windows: .venv\\Scripts\\activate\npip
        install anthropic\n```\n\nSet Anthropic API key:\n```bash\nexport ANTHROPIC_API_KEY=your_api_key\n```\n\nRun
        the `label-data` script:\n```bash\npython script/label-data\n```\n\nMaybe
        some files weren't labeled because the model didn't reply with a comma-separated
        list of labels:\n\n```bash\npython script/see-label-data\n```"
